import React from 'react';
import logo from './logo.svg';
import './App.css';

import LoginPage from './pages/LoginPage'

function App() {
  return (
    <Route exact path='/login' render={(props) => {
      return <LoginPage {...props} />
    }}/>
  );
}

export default App;
